#!/usr/bin/env bash
###
# install-ogre-sounds.sh
# Self-contained installer for DOTA 2 Ogre Magi sound effects as Claude Code hooks.
# All 25 MP3 files are embedded (base64) — no external downloads needed.
#
# Events:
#   SessionStart      → Spawn/greeting sounds ("Ogre Magi!", "They picked me!")
#   UserPromptSubmit  → Move/attack sounds ("Yeah!", "Here we go!", "Hittin stuff is fun")
#   Stop              → Multicast/skill sounds ("Pure skill!", "Damn. We're good.")
#   Notification      → Bloodlust/ignite sounds (permission prompts only)
#
# Prerequisites:
#   - macOS (uses afplay)
#   - jq
#
# Usage: bash install-ogre-sounds.sh
###
set -euo pipefail

HOOKS_DIR="$HOME/.claude/hooks"
SOUNDS_DIR="$HOOKS_DIR/sounds/ogre_magi"
SETTINGS="$HOME/.claude/settings.json"
HOOK_SCRIPT="$HOOKS_DIR/ogre-sound.sh"

# -- Preflight checks --
if ! command -v jq &>/dev/null; then
  echo "Error: jq is required. Install with: brew install jq" >&2
  exit 1
fi

if [[ "$(uname)" != "Darwin" ]]; then
  echo "Warning: This hook uses macOS 'afplay'. You may need to swap the player command on Linux." >&2
fi

# -- Create directories --
mkdir -p "$SOUNDS_DIR"
mkdir -p "$(dirname "$SETTINGS")"

echo "Extracting 25 Ogre Magi sound files..."

# -- Embedded sound files --
base64 -D << 'B64EOF' > "$SOUNDS_DIR/attack_02.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/attack_04.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/attack_05.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/battlebegins_01.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/bloodlust_01.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/bloodlust_02.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/ignite_01.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/ignite_02.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/kill_01.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/kill_04.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/laugh_01.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/move_01.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/move_02.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/move_04.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/multi_01.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/multi_04.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/multi_06.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/multi_hit_02.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/multi_hit_04.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/multi_hit_10.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/respawn_06.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/rival_04.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/spawn_01.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/spawn_02.mp3"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/spawn_04.mp3"

B64EOF

echo "All 25 sound files extracted to $SOUNDS_DIR"

# -- Create the hook script --
cat > "$HOOK_SCRIPT" << 'HOOKEOF'
#!/usr/bin/env bash
# ogre-sound: play DOTA 2 Ogre Magi sounds on Claude Code hook events
set -euo pipefail

SOUNDS_DIR="$HOME/.claude/hooks/sounds/ogre_magi"

# Read hook JSON from stdin
INPUT=$(cat)

EVENT=$(echo "$INPUT" | jq -r '.hook_event_name // ""' 2>/dev/null)

# Map events to sound categories
case "$EVENT" in
  SessionStart)
    # Spawn/greeting: "Ogre Magi!", "The very same", "They picked me!"
    SOUNDS=(spawn_01.mp3 spawn_02.mp3 spawn_04.mp3 battlebegins_01.mp3 respawn_06.mp3)
    ;;
  UserPromptSubmit)
    # Acknowledging work: "Yeah!", "Yup", "Here we go!", "Hittin stuff is fun"
    SOUNDS=(move_01.mp3 move_02.mp3 move_04.mp3 attack_02.mp3 attack_04.mp3 attack_05.mp3 bloodlust_01.mp3 bloodlust_02.mp3)
    ;;
  Stop)
    # Task complete: "Pure skill!", "Damn. We're good.", multicast hits, kills
    SOUNDS=(multi_01.mp3 multi_04.mp3 multi_06.mp3 multi_hit_02.mp3 multi_hit_04.mp3 multi_hit_10.mp3 kill_01.mp3 kill_04.mp3 rival_04.mp3 laugh_01.mp3)
    ;;
  Notification)
    # Permission prompts: ignite/bloodlust sounds
    IS_PERMISSION=$(echo "$INPUT" | jq -r '.notification_type // ""' 2>/dev/null)
    if [ "$IS_PERMISSION" = "permission_prompt" ] || echo "$INPUT" | jq -e 'tostring | test("permission"; "i")' >/dev/null 2>&1; then
      SOUNDS=(ignite_01.mp3 ignite_02.mp3 bloodlust_01.mp3 bloodlust_02.mp3 move_04.mp3)
    else
      exit 0
    fi
    ;;
  *)
    exit 0
    ;;
esac

# Pick a random sound
COUNT=${#SOUNDS[@]}
INDEX=$((RANDOM % COUNT))
SOUND_FILE="$SOUNDS_DIR/${SOUNDS[$INDEX]}"

# Play it (macOS)
if [ -f "$SOUND_FILE" ]; then
  afplay "$SOUND_FILE" &
fi
HOOKEOF
chmod +x "$HOOK_SCRIPT"
echo "Hook script created at $HOOK_SCRIPT"

# -- Wire into settings.json --
# Check if settings.json exists, create minimal one if not
if [ ! -f "$SETTINGS" ]; then
  echo '{}' > "$SETTINGS"
fi

# Add the ogre-sound hook to all relevant events
EVENTS=("SessionStart" "UserPromptSubmit" "Stop" "Notification")
HOOK_ENTRY='{"type":"command","command":"$HOME/.claude/hooks/ogre-sound.sh","timeout":5,"async":true}'

for event in "${EVENTS[@]}"; do
  # Check if the event already has hooks
  if jq -e ".hooks.${event}" "$SETTINGS" >/dev/null 2>&1; then
    # Check if ogre-sound hook already exists in this event
    if jq -e ".hooks.${event}[].hooks[] | select(.command == \"\$HOME/.claude/hooks/ogre-sound.sh\")" "$SETTINGS" >/dev/null 2>&1; then
      echo "  $event: ogre-sound hook already present, skipping"
    else
      # Add ogre hook to existing matcher's hooks array
      jq ".hooks.${event}[0].hooks += [$HOOK_ENTRY]" "$SETTINGS" > "${SETTINGS}.tmp" && mv "${SETTINGS}.tmp" "$SETTINGS"
      echo "  $event: added ogre-sound hook"
    fi
  else
    # Create new event with hook
    jq ".hooks.${event} = [{\"matcher\":\"\",\"hooks\":[$HOOK_ENTRY]}]" "$SETTINGS" > "${SETTINGS}.tmp" && mv "${SETTINGS}.tmp" "$SETTINGS"
    echo "  $event: created with ogre-sound hook"
  fi
done

echo ""
echo "Done! Ogre Magi sounds are now active."
echo "Voice lines by event:"
echo "  SessionStart     → 'Ogre Magi!', 'They picked me!', etc."
echo "  UserPromptSubmit → 'Yeah!', 'Here we go!', 'Bloodlust!'"
echo "  Stop             → 'Pure skill!', 'Damn. We're good.'"
echo "  Notification     → 'You should have put that out.', 'Hey, you are on fire.'"
echo ""
echo "To test: afplay $SOUNDS_DIR/multi_06.mp3"
